import React, { Component } from 'react'
import Card from './Card'

export class Cards extends Component {
    render() {
        return (
            <div cl1assName="cards">
                {this.props.cards.map(el => (
                    <Card key={el.id} card={el}/>
                ))}
            </div>
        )
    }
}

export default Cards
